export default [
    {
        id: '1',
        img: require('../.././assets/images/warmup/1.png'),
        title: 'Пожимание плечами:',
        description: 'Медленно поднимите плечи как можно выше вверх и снова опустите их.',
    },
    {
        id: '2',
        img: require('../.././assets/images/warmup/2.png'),
        title: 'Круговые движения плечами:',
        description: 'Делайте медленные вращательные движения плечами сначала вперед, потом назад. Руки расслабленно висят вдоль тела или лежат на коленях.',
    },
    {
        id: '3',
        img: require('../.././assets/images/warmup/3.png'),
        title: 'Наклоны туловища в стороны:',
        description: 'Встаньте во весь рост, расставьте ноги на ширину плеч и опустите руки вдоль тела. Делайте небольшие наклоны из стороны в сторону, руки расслабленно скользят вниз вдоль тела.',
    },
    {
        id: '4',
        img: require('../.././assets/images/warmup/4.png'),
        title: 'Поднимание коленей в положении сидя:',
        description: 'Поочередно медленно поднимайте и опускайте колени, как показано на рисунке.',
    },
    {
        id: '5',
        img: require('../.././assets/images/warmup/5.png'),
        title: 'Постукивания по поверхности пола/земли поочередно пальцами ног и пятками:',
        description: 'Постучите сперва пальцами ног, а затем пяткой одной ноги по поверхности пола/земли перед вами. Повторите то же самое действие другой ногой.',
    },
    {
        id: '6',
        img: require('../.././assets/images/warmup/6.png'),
        title: 'Круговые движения стопами:',
        description: 'Сидя на стуле, выполняйте круговые движения стопой сначала левой, а затем правой ноги.',
    },

]
